import React, { useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import Logo from "../../images/budget.png";
import { AppBarHeader } from "./AppbarElements";

const Appbar = () => {
  const [user, setUser] = useState(JSON.parse(localStorage.getItem("profile")));

  return (
    <AppBarHeader>
      <div className="logo-container">
        <img src={Logo} alt="Logo" />
      </div>

      <h2 className="app-name">Expense Tracker</h2>
      <img className="user-avatar" alt={user?.googleUserData?.name}  src={user?.googleUserData?.imageUrl}/>
    </AppBarHeader>
  );
};

export default Appbar;
